import * as constants from './constants';
import * as fcl from '@onflow/fcl';

export const toggleConnectWallet = (event,connectWallet) => {
  return async (dispatch) => {
    event.preventDefault();
    try {
      let user = fcl.currentUser().subscribe()
    } catch (err) {}
  }
};
